participants.description:
По настроению и несистемно (как вспышка) пишу тут из своих ролей;
- адвокат, "Гриц и партнеры";
- архитектор бизнес-партнерств, модератор партнерских сессий;
- к.ю.н., доцент НИУ ВШЭ;
- член Консультативного совета Яндекса
- автор пары книг

Автор - Александр Малютин, судебный юрист.
На канале:
Практические советы для юристов и бизнеса;
Необычные юридические кейсы и немного теории;
Правовой опыт зарубежных стран.
